import React, { useState } from "react";

import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

import ChallanIndex from "./subIndex";

const DeliveryChallanIndex = () => {
  const challanType = new URLSearchParams(window.location.search).get("type");
  const history = useHistory();
  console.log(challanType);

  return (
    <div className="card card-custom gutter-b  px-7 py-3">
      <ul className="nav nav-tabs nav-tabs-line">
        <li className="nav-item">
          <a
            className={
              `nav-link ` +
              (decodeURIComponent(challanType) === "SL" || challanType === null
                ? "active"
                : "")
            }
            onClick={() => {
              window.location.href = `/logistics/delivery-challan?type=${encodeURIComponent(
                "SL"
              )}`;
            }}
          >
            SL DC
          </a>
        </li>
        <li className="nav-item">
          <a
            className={
              `nav-link ` +
              (decodeURIComponent(challanType) === "Non SL" ? "active" : "")
            }
            onClick={() =>
              (window.location.href = `/logistics/delivery-challan?type=${encodeURIComponent(
                "Non SL"
              )}`)
            }
          >
            Non SL DC
          </a>
        </li>
        <li className="nav-item">
          <a
            className={
              `nav-link ` +
              (decodeURIComponent(challanType) === "Non SL" ? "active" : "")
            }
            onClick={() =>
              (window.location.href = `/logistics/delivery-challan?type=${encodeURIComponent(
                "Non SL"
              )}`)
            }
          >
            Non SL DC
          </a>
        </li>
        <li className="nav-item">
          <a
            className={
              `nav-link ` +
              (decodeURIComponent(challanType) === "Non SL" ? "active" : "")
            }
            onClick={() =>
              (window.location.href = `/logistics/delivery-challan?type=${encodeURIComponent(
                "Non SL"
              )}`)
            }
          >
            Non SL DC
          </a>
        </li>
        <li className="nav-item">
          <a
            className={
              `nav-link ` +
              (decodeURIComponent(challanType) === "Non SL" ? "active" : "")
            }
            onClick={() =>
              (window.location.href = `/logistics/delivery-challan?type=${encodeURIComponent(
                "Non SL"
              )}`)
            }
          >
            Non SL DC
          </a>
        </li>
      </ul>
      <div className="tab-content">
        <ChallanIndex
          type={challanType ? decodeURIComponent(challanType) : "SL"}
        />
      </div>
    </div>
  );
};

export default DeliveryChallanIndex;
